import React from 'react';

class WhyThisNonProfit extends React.Component {
    render() {
        return (
            <div className="jumbotron">
            <h1 className="display-4">Why This Non Profit</h1>
            <img src="../images/image-1.jpg" height="500" width="500" alt=""></img>
            <p className="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
            <hr className="my-4"></hr>
            <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
            <a className="btn btn-primary btn-lg" href="/why_non_profit" role="button">Learn more</a>
          </div>
        )
    }
};

export default WhyThisNonProfit;
